import React, { Component } from 'react';
import Layout from './../../../components/Layout';

class RequestNew extends Component {
	 render() {
	 	return (
			<Layout>
				<h3>Create a request</h3>
			</Layout>
	 	)
	 }
}

export default RequestNew;
